import { createAnswersComponent } from '../src/app/AnswersComponent';
import launchGame from '../src/app/logic/LaunchTheGame/LaunchTheGame';
import { GameModes } from '../src/app/Consts';
import modalWindow from '../src/app/uicomponents/ModalWindow/ModalWindow';

jest.mock('../src/app/logic/questionsGenerator/QuestionsGenerator', () => jest.fn().mockResolvedValue({
    image: "",
    answers: [
        "Jek Tono Porkins",
        "Ratts Tyerel",
        "Mas Amedda",
        "Nute Gunray",
    ],
    rightAnswer: "Ratts Tyerel",
}))


describe(('Launch the game tests'), () => {

    test('should invoke modal window function after 120s', async() => {
        const modalWindow = jest.fn();
        jest.useFakeTimers();

        const imageDiv = document.createElement('div');
        imageDiv.className = 'image';
        document.body.appendChild(imageDiv);
        document.body.appendChild(createAnswersComponent());

        await launchGame(GameModes.PEOPLE);
        jest.advanceTimersByTime(120 * 1000);

        expect(document.body.querySelector('.modal-window')).toBeTruthy();
    })
})